    false,nt"url": null,nt"notes": "Anuran call surveys were conducted at the
    Canaan Valley National Wildlife Refuge for the first time in 2000 so this report
    summarizes the results of the refugeu2019s third year of anuran call surveys. It
    is estimated that 39% of West Virginia's wetlands are located in the Canaan Valley
    and it is considered one of the most significant wetland complexes in the mid-Atlantic
    regions. These wetlands at Canaan Valley National Wildlife Refuge are important
    feeding and breeding areas for at least 21 species of amphibians including 15 salamanders,
    5 frogs and one toad. One of the goals of the refuge is to protect these wetland
    communities and monitor the biological diversity of species utilizing these habitats.",nt"license_title":
